// FLASH MESSAGE ERROR OR SUCESS

$(document).ready(function() {
  var flash_message = $('.success_message');
  
  if (flash_message.length > 0) {
    flash_message.fadeIn();
    window.setTimeout(function() {
      flash_message.fadeOut();
    }, 3000);
  }
});

